using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace LeetCode
{
    /// Given a string, find the length of the longest substring without repeating characters.

    /// Example 1:
    /// Input: "abcabcbb"
    /// Output: 3 
    /// Explanation: The answer is "abc", with the length of 3. 
    /// 
    /// Example 2:
    /// Input: "bbbbb"
    /// Output: 1
    /// Explanation: The answer is "b", with the length of 1.
    /// 
    /// Example 3:
    /// Input: "pwwkew"
    /// Output: 3
    /// Explanation: The answer is "wke", with the length of 3. 
    /// 
    /// Note that the answer must be a substring, "pwke" is a subsequence and not a substring.                          
    /// 

    //[Sliding Windows]
    class LongestSubstringWithoutRepeatChar
    {
        public LongestSubstringWithoutRepeatChar()
        {
            Console.WriteLine("Longest Substring:");

            var watch = System.Diagnostics.Stopwatch.StartNew();
            Console.WriteLine(
                "Test case 1 : " + (LengthOfLongestSubstring() == 12 ? "Passed" : "Failed")
            );
            watch.Stop();
            var elapsedMs = watch.ElapsedMilliseconds;
            Console.WriteLine("Test case medium string time : " + elapsedMs.ToString());

            Console.ReadLine();
        }

        private string Substring
        {
            get
            {
                return "";
            }
        }

        public int LengthOfLongestSubstring()
        {
            ///return BruteForce(Substring);

            return SlidingWindowSearch(Substring);
        }

        public int BruteForce(string s)
        {
            int longestSubstring = 0;
            int i = 0;
            string currentSubstring = "";

            while (i < s.Length)
            {

                currentSubstring += s[i].ToString();

                int j = i + 1;
                while (j < s.Length)
                {
                    if (!currentSubstring.Contains(s[j]))
                    {
                        currentSubstring += s[j++].ToString();
                    }
                    else
                    {
                        break;
                    }
                }

                longestSubstring = Math.Max(longestSubstring, currentSubstring.Length);
                currentSubstring = "";
                i++;
            }

            return longestSubstring;
        }

        public int SlidingWindowSearch(string s)
        {
            if (s.Length == 0) return 0;

            int longestSubstring = 1;
            int i = 1;
            string currentSubstring = s[0].ToString();

            while (i < s.Length)
            {
                if (!currentSubstring.Contains(s[i]))
                {
                    currentSubstring += s[i++].ToString();
                    longestSubstring = Math.Max(longestSubstring, currentSubstring.Length);
                }
                else
                {
                    currentSubstring = currentSubstring.Remove(0, 1);
                }
            }

            return longestSubstring;
        }
    }
}
